def sort_combined_count(x, y, z):
    combined = x + y - z
    frequency_dict = {}
    for num in combined:
        if num in frequency_dict:
            frequency_dict[num] += 1
        else:
            frequency_dict[num] = 1
    return dict(sorted(frequency_dict.items(), key=lambda item: item[1], reverse=True))

